import React from 'react';
import styles from './index.module.scss';



export class GoodsShow extends React.Component {
    handleClick(click) {
        click = !click;
        // return click;
        console.log(click);
    }

    render() {
        let click = false;
        console.log(click);
        return (
            <div>
                <div className={click ? styles.bigImg : styles.img} onClick={() => this.handleClick(click)}></div>
                <div className={styles.content}></div>
            </div>
        );
    }
}
